B.z_=new A.aO("Seguro de RCTR-C","Seguro de RCTR-C \u2013 Responsabilidade Civil do Transportador Rodovi\xe1rio de Carga \n Quando pensamos em \u201cque tipos de seguro de carga existem?\u201d, n\xe3o podemos deixar de falar do seguro de RCTR-C, que aplica-se para danos e perdas das cargas inerentes a acidentes de tr\xe2nsito durante o transporte. Tamb\xe9m muito conhecido como RC ou seguro obrigat\xf3rio (desde 1966), no qual muitos transportadores j\xe1 utilizam.",null)
B.yX=new A.aO("Seguro de RCF-DC","Responsabilidade Civil Facultativa por Desaparecimento de carga \n O Seguro de RCF-DC \xe9 usado tamb\xe9m por transportadores, para garantir as perdas com roubos de carga durante o tr\xe2nsito. Por ser um seguro facultativo, sua contrata\xe7\xe3o n\xe3o \xe9 obrigat\xf3ria e depende que seja contratado primeiro, o seguro de RCTR-C. \n Neste tipo de seguro, aplicamos as regras de gerenciamento de risco, onde visam aumentar a seguran\xe7a nos embarques, de forma que os preju\xedzos possam ser minimizados.",null)
B.ym=new A.aO("Seguro de TN (Transporte Nacional)","Nesta modalidade, entram os embarcadores (que s\xe3o os propriet\xe1rios da mercadoria que transportam e possuem gest\xe3o sobre ela). Toda a cadeia de produ\xe7\xe3o do embarcador est\xe1 amparada, seja compra de mat\xe9ria-prima, transfer\xeancia para beneficiamento, entrega ao cliente final, n\xe3o entregas e redespacho, garantindo assim ao embarcador, todo o processo log\xedstico. \n\n Por ser um seguro com uma gama ampla de coberturas, \xe9 necess\xe1rio entender a opera\xe7\xe3o de cada cliente e aplicar as melhores condi\xe7\xf5es e coberturas que visar\xe3o mais tranquilidade no dia a dia.",null)
B.yy=new A.aO("Seguro Avulso","O Seguro Avulso \xe9 utilizado para uma \xfanica viagem. \xc9 feito um seguro em nome do dono da carga, em que ele pode optar por quem ir\xe1 transportar sua mercadoria. \n\n Pode ser usado tanto no modal rodovi\xe1rio, quanto mar\xedtimo ou at\xe9 mesmo a\xe9reo. \n\n Por ser um seguro \xfanico, \xe9 precificado de acordo com a mercadoria a ser transportada. Ap\xf3s pagamento do pr\xeamio do seguro e valida\xe7\xe3o da cobertura, a viagem pode seguir.",null)
B.yY=new A.aO("Internacional \u2013 Importa\xe7\xe3o e Exporta\xe7\xe3o","Com a grande demanda atualmente, os seguros de importa\xe7\xe3o e exporta\xe7\xe3o, permitem que as mercadorias importadas/exportadas sejam amparadas em casos de acidentes e roubos durante o transporte rodovi\xe1rio, transporte mar\xedtimo ou a\xe9reo.Toda a opera\xe7\xe3o demanda \xa0uma an\xe1lise de onde inicia e termina a reponsabilidade do seguro, no qual \xe9 definido na venda do produto para importa\xe7\xe3o ou exporta\xe7\xe3o. \n\n Esse seguro garante cobertura a eventuais incidentes, como extravios, perdas e avarias no decorrer do deslocamento da carga. \n\n A contrata\xe7\xe3o deve ser realizada conforme os riscos que o deslocamento oferece e tamb\xe9m devem ser consideradas as condi\xe7\xf5es de negocia\xe7\xe3o das mercadorias. \n\n Tamb\xe9m \xe9 necess\xe1rio prestar aten\xe7\xe3o \xe0 modalidade de transporte, ou seja, se ser\xe1 mar\xedtima, a\xe9rea ou terrestre. Os seguros de transporte internacional de cargas podem ser contratados tanto pelos importadores quanto pelos exportadores, sendo que essa quest\xe3o \xe9 decidida durante a negocia\xe7\xe3o dos produtos.",null)
