B.yi=new A.aO("Lucros cessantes em decorr\xeancia de RC","A cobertura repara preju\xedzos ou perdas financeiras decorrentes de danos causados a terceiros em fun\xe7\xe3o dos trabalhos realizados na obra.",null)
B.yT=new A.aO("Erro de projeto","Tem o objetivo de amparar danos materiais e/ou corporais ocorridos a terceiros durante a execu\xe7\xe3o de obra ou servi\xe7o em raz\xe3o de erros de projeto.",null)
B.yQ=new A.aO("Derramamento, infiltra\xe7\xe3o e/ou descarga de \xe1gua","Derramamentos, infiltra\xe7\xf5es e descargas de \xe1gua podem causar enormes preju\xedzos para os envolvidos em trabalhos de constru\xe7\xe3o civil. Sendo assim, \xe9 poss\xedvel contratar uma cobertura espec\xedfica para esse fim.",null)
