B.yJ=new A.aO("Despesas m\xe9dicas, Viagem internacional","Despesas m\xe9dicas, hospitalares e/ou odontol\xf3gicas em viagem ao exterior (DMHO viagem internacional)\u2013 Ela garante os mesmos itens da cobertura anterior:  indeniza\xe7\xe3o das despesas m\xe9dicas, hospitalares ou odontol\xf3gicas devido acidente pessoal ou doen\xe7a s\xfabita. A diferen\xe7a \xe9 que, por ser voltada para viagens internacionais, ela come\xe7a a valer assim que voc\xea sair do seu pa\xeds de origem.",null)
