B.yS=new A.aO("Ap\xf3lices coletivas","Diferente do grupo de afinidades, aqui a ap\xf3lice \xe9 emitida para uma \xfanica pessoa, seja ela jur\xeddica ou f\xedsica, pois toda a frota de carros est\xe1 em seu nome. Dessa forma, a cobran\xe7a \xe9 \xfanica. Se o contrato de seguro for feito por uma pessoa jur\xeddica, \xe9 poss\xedvel incluir tamb\xe9m os ve\xedculos dos diretores e das empresas subsidi\xe1rias ou coligadas, desde que sejam legalmente reconhecidas.",null)
