B.yq=new A.aO("Coberturas Adicionais","Equipamentos \u2013 Blindagem, Kit g\xe1s e outros \n\n - Carro reserva: o seguro garante a disponibilidade de um ve\xedculo extra enquanto o principal estiver em manuten\xe7\xe3o; \n\n Lucros cessantes: o segurado pode receber as di\xe1rias pelos dias n\xe3o trabalhados enquanto o ve\xedculo estiver indispon\xedvel; \n\n Despesas extraordin\xe1rias: nos casos de indeniza\xe7\xe3o integral, fica garantido o reembolso de outras despesas que possam acontecer; \n\n Acess\xf3rios: a cobertura abrange os acess\xf3rios roubados ou danificados no ve\xedculo, como aparelhos de som ou GPS;",null)
